import React from "react";
import Card_Movie from "./Card_Movie";
import popular_movie_data from "../data/popular_movie_data";

export const Horizontal_Scroller = () => {
  const { results } = popular_movie_data;
  console.log(results);
  return (
    <section className="container p-12">
      <h1 className="text-center mb-12 text-5xl font-bold">Popular</h1>

      <div className="flex">
        {results.map((movie, index) => {
          const { title, release_date, vote_average, poster_path } = movie;
          <Card_Movie
            key={index}
            value={(title, release_date, vote_average, poster_path)}
          />;
        })}
        <Card_Movie />
        <Card_Movie />
      </div>
    </section>
  );
};

export default Horizontal_Scroller;
